// SPDX-License-Identifier: AGPL-3.0
pragma solidity  ^0.8.17;


contract StrutTest {


    SellOrderItem[] public items;

    // sell order item
    struct SellOrderItem {
        address nftContract;
        uint256 sellOrderId;
        uint256 nftId;
        uint256 price;
        bool state;
    }

    function getItems() public  view returns (SellOrderItem[] memory) {
        return items;
    }

    function length() public  view returns (uint256 c) {
        return items.length;
    }

    function addValue(SellOrderItem memory itme) public  {
        items.push(itme);
    }

    function add(SellOrderItem memory itme,uint index) public  {
        items[index] = itme;
    }

    function deleteByIndex(uint index) public  {
       delete items[index];
    }

}
